import './App.css';
import Post from "./Post";
import Header from "./Header";
import Layout from "./Layout";
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout />}>
        <Route index element={
            <main>
              <Header />
              <Post />
              <Post />
              <Post />  
            </main>
        } />
        <Route path='/login' element={
            <main>
              <Header />
              <div>login page</div>
            </main>
        } />
      </Route>
    </Routes>
  );
}

export default App;
